const ROWS = 1;
const COLUMNS = 1;
const LAYERS = 2;
const OBSTACLES = false;

const layer = [];

for (let i = 0; i < ROWS; i++) {
  layer[i] = [] as number[];
  for (let j = 0; j < COLUMNS; j++)
    layer[i][j] = 0;
}


if (OBSTACLES) {
  if (ROWS > 2) {
    const middle = Math.ceil(ROWS / 2);
    for (let i = 1; i < COLUMNS - 1; i++)
      layer[middle][i] = 1;
  }

  if (ROWS > 4) {
    for (let i = 1; i < COLUMNS - 1; i++)
      layer[1][i] = 1;
  }

  if (COLUMNS > 2) {
    const middle = Math.floor(COLUMNS / 2);
    for (let i = 0; i < ROWS - 1; i++)
      layer[i][middle] = 1;
  }
}


const map = [];

for (let i = 0; i < LAYERS; i++)
  map.push(layer);

export default map;


